import React from "react";

function Box({ color, width, height, deleteBox }) {
  let widthString = `${width}0px`;
  let heightString = `${height}0px`;

  return (
    <div className="Box">
      <div
        style={{
          backgroundColor: color,
          width: widthString,
          height: heightString,
        }}
      ></div>
      <button onClick={deleteBox()}>X</button>
    </div>
  );
}

export default Box;
